import React, { useState, useEffect, useRef } from 'react';
import { deleteJob } from './utils/jobs_list/DeleteJob.js';
import Portal from './StatusDropdownPortal.js';

const JobsList = ({ removeJobCallBack, jobsState }) => {
  const [openDropdownId, setOpenDropdownId] = useState(null);
  const [dropdownCoords, setDropdownCoords] = useState({ top: 0, left: 0 });
  const dropdownRef = useRef(null);

  const toggleDropdown = (e, jobId) => {
    e.stopPropagation();
    const button = e.currentTarget;
    const rect = button.getBoundingClientRect();

    // Calculate position with viewport boundaries
    const viewportHeight = window.innerHeight;
    const dropdownHeight = 150; // Approximate dropdown height
    const spaceBelow = viewportHeight - rect.bottom;

    setDropdownCoords({
      top: spaceBelow < dropdownHeight 
        ? rect.top + window.scrollY - dropdownHeight
        : rect.bottom + window.scrollY,
      left: rect.left + window.scrollX,
      width: rect.width
    });

    setOpenDropdownId(openDropdownId === jobId ? null : jobId);
  };

  useEffect(() => {
    const handleClickOutside = (e) => {
      if (dropdownRef.current && !dropdownRef.current.contains(e.target)) {
        setOpenDropdownId(null);
      }
    };

    document.addEventListener('click', handleClickOutside);
    return () => document.removeEventListener('click', handleClickOutside);
  }, []);

  const handleDeleteJob = (e, jobId, jobCompany, jobTitle) => {
    e.preventDefault();
    deleteJob(jobId, jobCompany, jobTitle);
    removeJobCallBack(jobId);
    setOpenDropdownId(null);
  };

  const countJobStatus = () => {
    return {
      applied: jobsState.filter(job => job.status === 'Applied').length,
      rejected: jobsState.filter(job => job.status === 'Rejected').length,
      interview: jobsState.filter(job => job.status === 'Interview').length,
    };
  };

  return (
    <div className="box p-0" style={{ marginTop: '20px' }}>
      <div
        className="table-container jobs-table-container"
        style={{
          maxHeight: '60vh',
          overflowY: 'auto',
          border: '1px solid #dbdbdb',
          borderRadius: '4px',
        }}
      >
        <table className="table is-fullwidth is-striped is-hoverable" style={{ tableLayout: 'fixed', width: '100%' }}>
          <thead>
            <tr className="has-text-centered">
              <th colSpan="7" className="has-text-centered">
                Applied Jobs: {countJobStatus().applied}
              </th>
            </tr>
            <tr>
              <th style={{ width: '15%' }}>Company</th>
              <th style={{ width: '15%' }}>Position</th>
              <th style={{ width: '10%' }}>Date</th>
              <th style={{ width: '10%' }}>Status</th>
              <th style={{ width: '20%' }}>Location</th>
              <th style={{ width: '10%' }}>URL</th>
              <th style={{ width: '20%' }}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {jobsState.map(job => (
              <tr key={job.id}>
                <td>{job.company}</td>
                <td>{job.position}</td>
                <td className="jobs-table-narrow-column">{job.date}</td>
                <td className="jobs-table-narrow-column">
                  <span className={`tag ${job.status}`}>{job.status}</span>
                </td>
                <td>{job.location}</td>
                <td className="jobs-table-narrow-column">
                  <a href={job.url} target="_blank" rel="noopener noreferrer">
                    link
                  </a>
                </td>
                <td className="jobs-actions">
                  <button 
                    className="button" 
                    onClick={(e) => toggleDropdown(e, job.id)}
                    aria-expanded={openDropdownId === job.id}
                    aria-controls={`dropdown-${job.id}`}
                  >
                    Actions â–¼
                  </button>

                  {openDropdownId === job.id && (
                    <Portal>
                      <div
                        id={`dropdown-${job.id}`}
                        ref={dropdownRef}
                        className="dropdown-menu is-active"
                        style={{
                          position: 'absolute',
                          top: `${dropdownCoords.top}px`,
                          left: `${dropdownCoords.left}px`,
                          zIndex: 9999,
                          backgroundColor: 'white',
                          border: '1px solid #ccc',
                          borderRadius: '4px',
                          boxShadow: '0 2px 6px rgba(0,0,0,0.2)',
                          padding: '10px',
                          minWidth: '150px',
                        }}
                        onClick={e => e.stopPropagation()}
                      >
                        <div className="dropdown-content">
                          <a className="dropdown-item">Rejected</a>
                          <a className="dropdown-item">Interview</a>
                          <a
                            className="dropdown-item"
                            onClick={(e) => handleDeleteJob(e, job.id, job.company, job.position)}
                          >
                            Delete
                          </a>
                        </div>
                      </div>
                    </Portal>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default JobsList;
